import React from 'react'

export default function Textform() {
  return (
    <div>
    <h1>Enter your text to write</h1>
    <div class="mb-3">
      <textarea class="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
    </div>
    </div>
  )
}
